import { format, parseISO } from "date-fns";

import { LinkButton } from "@/components";

export default function QutationsCard({ qutation }) {
  function formatDateTime(dateTimeString) {
    const date = parseISO(dateTimeString);
    const formattedDate = format(date, "dd / MM / yyyy - HH : mm 'PM'");
    return formattedDate;
  }

  return (
    <div className="rounded-[10px] flex flex-col items-center justify-center gap-8 bg-white p-[20px] bg-netural-100 border border-divider ">
      <div className="flex flex-row items-center justify-between gap-8 w-full">
        <p className="body_small text-body">رقم طلب التسعير :</p>
        <h2 className="subtitle text-netural-900">#{qutation.id}</h2>
      </div>
      <div className="flex flex-row items-center justify-between gap-8 w-full">
        <p className="body_small text-body">تسعير المواد :</p>
        <h2 className="subtitle text-netural-900">
          {qutation.quotation_amount !== null
            ? `${qutation.quotation_amount} SAR`
            : "N/A"}
        </h2>
      </div>
      <div className="flex flex-row items-center justify-between gap-8 w-full">
        <p className="body_small text-body">التاريخ والوقت :</p>
        <span className="subtitle text-netural-900" dir="ltr">
          {formatDateTime(qutation.createdAt)}
        </span>
      </div>
      <div className="flex flex-row items-center justify-between gap-8 w-full">
        <p className="body_small text-body">الحالة :</p>
        {getStatus(qutation.status)}
      </div>
      <LinkButton
        variant="text"
        fullWidth
        className="border rounded-[0.75rem] border-divider text-netural-900 hover:text-netural-900"
        text="عرض تفاصيل الطلب"
        href={`/quotations/${qutation.id}`}
      />
    </div>
  );
}
